import CartItem from "./CartItem";

export default function CartItemList({items}) {
    return (
        <div className="CartList">
            {
                items.map((el) => {
                    return (
                        <CartItem key={el.id} id={el.id} category={el.category} description={el.description} price={el.price} title={el.title} />    
                    )
                })
            }
        </div>
    )
}
